import React from "react";
import { TopNavBar, SideNavBar, Routes } from "./components/navigation";

const App = () => {
  return (
    <div>
      <SideNavBar />
      <TopNavBar />
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/about" component={About} />
        <Route path="/products" component={Products} />
      </Switch>
    </div>
  );
};

export default App;
